INSERT INTO `Product` (`id`, `name`, `productAddedDate`, `productBackSets`, `productBarCodeId`, `productDescription`, `productGrade`, `productKeyTypes`, `productLeverDesign`, `productListPrice`, `productNetPrice`, `productQuantity`, `productType`, `productWeight`, `quantityStatus`, `categoryId`) VALUES
(2, 'Arrow Locks', NULL, '2 -3/4"', '026229140709', '<h2><strong>Entrance</strong></h2>\r\n<ul>\r\n<li>Latch by lever either side except when pushing turn button locks outside lever</li>\r\n<li>&nbsp;Unlocked by turning inside lever , or using key outside</li>\r\n<li><span style="font-family: Symbol;"><span>T</span></span>urning inside button keeps outside lever locked</li>\r\n<li><span style="font-family: Symbol;"><span>K</span></span>ey will retract latch</li>\r\n</ul>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 0in;">cold rolled steel with zinc dichromate finish for corrosion resistance. Latch retractor is precision cast steel. Door thickness is 1<sup>3/4 </sup><span>&nbsp;</span>" Standard</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever set', 'Arrow, I/C', 'Sierra Design', 169, 130, 10, ' LW11SR', 10, NULL, 15),
(3, 'Arrow Locks', NULL, '2 -3/4"', '', '<h2><strong>Store Room</strong></h2>\r\n<ul>\r\n<li>Latch by inside lever. outside lever always rigid</li>\r\n<li>key will retract latch</li>\r\n</ul>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 0in;">cold rolled steel with zinc dichromate finish for corrosion resistance. Latch retractor is precision cast steel. Door thickness is 1<sup>3/4 </sup><span>&nbsp;</span>" Standard</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever set', 'Arrow, I/C', 'Sierra Design', 169, 130, 10, 'LW12SR', 10, NULL, 16),
(4, 'Arrow Locks', NULL, '2 -3/4"', '', '<h2>&nbsp;<strong>ClassRoom</strong></h2>\r\n<ul>\r\n<li><span style="font-family: Symbol;"><span><span style="font: 7pt ''Times New Roman'';">&nbsp;</span></span></span>Latch volt operated by lever either side except when key outside locks outside lever</li>\r\n<li><span style="font-family: Symbol;"><span>I</span></span>nside lever always free</li>\r\n<li>Key will lock or unlock outside lever</li>\r\n</ul>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 0in;">cold rolled steel with zinc dichromate finish for corrosion resistance. Latch retractor is precision cast steel. Door thickness is 1<sup>3/4 </sup><span>&nbsp;</span>" Standard</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever Locks', 'Arrow, I/C', 'Sierra Design', 169, 130, 10, ' LW17SR', 10, NULL, 17),
(5, 'Corbin Russwin Lock', NULL, '2 -3/4"', '', '<h2><strong>Entrance</strong></h2>\r\n<ul>\r\n<li>Latch by lever either side except when pushing turn button locks outside lever</li>\r\n<li>&nbsp;Unlocked by turning inside lever , or using key outside</li>\r\n<li><span style="font-family: Symbol;"><span>T</span></span>urning inside button keeps outside lever locked</li>\r\n<li><span style="font-family: Symbol;"><span>K</span></span>ey will retract latch</li>\r\n</ul>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 0in;">cold rolled steel with zinc dichromate finish for corrosion resistance. Latch retractor is precision cast steel. Door thickness is 1<sup>3/4 </sup><span>&nbsp;</span>" Standard, (Removable core not included)</p>', 'Extra heavy Duty Lever Sets', 'L4, 60,  removable core', 'Newport design(NZD)', 275.6, 212, 10, 'CL3351NZD', 10, NULL, 15),
(6, 'Corbin Russwin Locks', NULL, '2 -3/4"', '', '<h2><strong>ClassRoom</strong></h2>\r\n<ul>\r\n<li><span style="font-family: Symbol;"><span><span style="font: 7pt ''Times New Roman'';">&nbsp;</span></span></span>Latch bolt operated by lever either side except when key outside locks outside lever</li>\r\n<li><span style="font-family: Symbol;"><span>I</span></span>nside lever always free</li>\r\n<li>Key will lock or unlock outside lever</li>\r\n</ul>\r\n<p>cold rolled steel with zinc dichromate finish for&nbsp;corrosion resistance. Latch retractor is precision cast steel. Door thickness is 1<sup>3/4&nbsp;</sup><span>&nbsp;</span>" Standard, (Removable core not included)</p>', 'Extra heavy Duty Lever Sets', 'L4, 60,  removable core', 'Newport design(NZD)', 275.6, 212, 10, 'CL3355NZD', 10, NULL, 17),
(7, 'Corbin Russwin Locks', NULL, '2 -3/4"', '', '<h2><strong>Storeroom Lock</strong></h2>\r\n<p>&bull; Outside lever is fixed.</p>\r\n<p>&bull; Entrance by key only.</p>\r\n<p class="MsoNormal">&bull; Inside lever always unlocked.</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;cold rolled steel with zinc dichromate finish for corrosion resistance. Latch retractor is precision cast steel. Door thickness is 1<sup>3/4&nbsp;</sup><span>&nbsp;</span>" Standard, (Removable core not included)</p>', 'Extra heavy Duty Lever Sets', 'L4, 60,  removable core', 'Newport design(NZD)', 275.6, 212, 10, 'CL3357NZD', 10, NULL, 16),
(8, 'Schlage Lock', NULL, '2 -3/4"', '', '<h2><strong>Passage</strong></h2>\r\n<ul>\r\n<li>Handing: Non handed</li>\r\n<li>Door Thickness: 1<sup>5/8</sup>" to 2<sup>1/8"</sup>(41mm to 54 mm) standard including vandlgard(r) functions</li>\r\n<li>Lock chassis: zinc plated for corrosion resistance</li>\r\n<li><span style="font-family: Symbol;"><span><span style="font: 7pt ''Times New Roman'';">&nbsp;</span></span></span>latch bolt: steel<span>&nbsp; </span>1/2"(12mm) deadlocking on keyed and exterior function</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever set', '', 'Athens(ATH)', 228.15, 175.5, 10, ' ND10S ATH', 10, NULL, 18),
(9, 'Schlage Lock', NULL, '2 -3/4"', '', '<h2><strong>Exit</strong></h2>\r\n<p class="MsoNormal">&bull; Blank plate outside.</p>\r\n<p class="MsoNormal">&bull; Inside lever always unlocked.</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever set', '', ' Rhodes(RHO)', 228.15, 175.5, 9, 'ND25 RHO', 10, NULL, 19),
(10, 'Schlage Lock', NULL, '2 -3/4"', '', '<h2><strong>Bath/Bedroom Privacy Lock</strong></h2>\r\n<p>&bull; Push-button locking.</p>\r\n<p>&bull; Can be opened from outside with a small screwdriver.</p>\r\n<p class="MsoNormal">&bull; Turn inside lever or close door to release button.</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever Sets', '', 'Athens(ATH)', 261.95, 201.5, 10, ' ND40S ATH', 10, NULL, 20),
(11, 'Schlage Lock', NULL, '2 -3/4"', '', '<h2><strong>Entrance</strong></h2>\r\n<ul>\r\n<li>Latch by lever either side except when pushing turn button locks outside lever</li>\r\n<li>&nbsp;Unlocked by turning inside lever , or using key outside</li>\r\n<li><span style="font-family: Symbol;"><span>T</span></span>urning inside button keeps outside lever locked</li>\r\n<li><span style="font-family: Symbol;"><span>K</span></span>ey will retract latch</li>\r\n</ul>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 0in;">cold rolled steel with zinc dichromate finish for corrosion resistance. Latch retractor is precision cast steel. Door thickness is 1<sup>3/4 </sup><span>&nbsp;</span>" Standard</p>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 0in;">REMOVABLE CORE NOT INCLUDED</p>', 'Extra heavy Duty Lever Sets', 'C, C123, C145,  removable core,', 'Athens(ATH)', 308.75, 237.5, 10, 'ND53 ATH', 10, NULL, 15),
(12, 'Schlage Lock', NULL, '2 -3/4"', '', '<h2 class="MsoNormal"><strong>Classroom LocK</strong></h2>\r\n<p class="MsoNormal">&bull; Outside lever locked and unlocked by key.</p>\r\n<p class="MsoNormal">&bull; Inside lever always unlocked.</p>\r\n<p class="MsoNormal">REMOVABLE CORE NOT INCLUDED</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever Sets', 'C, C123, C145,  removable core,', 'Athens(ATH)', 308.75, 237.5, 10, ' ND70 ATH', 10, NULL, 17),
(13, 'Schlage Lock', NULL, '2 -3/4"', '026229140709', '<h2><strong>Classroom Security Lock</strong></h2>\r\n<p>&bull; Key in either lever locks or unlocks outside lever.</p>\r\n<p class="MsoNormal">&bull; Inside lever is always unlocked.&nbsp;</p>\r\n<p class="MsoNormal">REMOVABLE CORE NOT INCLUDED</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever Sets', 'C, C123, C145,  removable core', 'Athens(ATH) Design', 365.3, 281, 10, 'ND75 ATH', 10, NULL, 21),
(14, 'Schlage Lock', NULL, '2 -3/4"', '', '<h2>&nbsp;<strong>Storeroom Lock</strong></h2>\r\n<p>&bull; Outside lever is fixed.</p>\r\n<p>&bull; Entrance by key only.</p>\r\n<p class="MsoNormal">&bull; Inside lever always unlocked.</p>\r\n<p class="MsoNormal">REMOVABLE CORE NOT INCLUDED</p>\r\n<p>&nbsp;</p>', 'Extra heavy Duty Lever Sets', 'C, C123, C145,  removable core', 'Athens(ATH)', 300.95, 231.5, 10, 'ND80 ATH', 10, NULL, 16),
(27, 'Yale Locks', NULL, '2 -3/4"', '', '<h2><strong>Entry Lock</strong></h2>\r\n<p>&bull; For entrance, general home or officedoors.<br />&bull; Deadlocking latchbolt.<br />&bull; Either lever operates latchbolt (except when outside lever is&nbsp;&nbsp;&nbsp; locked from inside).<br />&bull; Pushing turn button in inside lever locks outside lever, and automatically releases when inside lever is turned or key is rotated in locked outside lever.<br />&bull; Outside lever may be retained in locked position by pushing and rotating turn button 90&deg; clockwise to a horizontal position; not released until turn button is manually returned to the vertical position.<br />&bull; Latchbolt is operated by key in outside lever or by rotating inside lever.<br />&bull; Inside lever always active.</p>', 'Extra heavy Duty Lever Sets', 'Y1, GB, Sec', 'Augusta', 289.224, 222.48, 10, 'AU5407LN', 10, NULL, 15),
(28, 'Yale Locks', NULL, '2 -3/4"', '', '<h2><strong>Storeroom</strong></h2>\r\n<p>&bull; For use on storeroom, utility, and exit doors.<br />&bull; Deadlocking latchbolt.<br />&bull; Latchbolt operated by lever inside, key in outside lever.<br />&bull; Outside lever always locked.<br />&bull; Inside lever always active.</p>', 'Heavy Duty Lever ', 'Y1, GB,  Sec', 'Augusta', 289.224, 222.48, 10, 'Au5405LN', 10, NULL, 16),
(29, 'Yale Locks', NULL, '2 -3/4"', '', '<h2><strong>Classroom Lock</strong></h2>\r\n<ul>\r\n<li>For classroom or utility room doors.</li>\r\n<li>Deadlocking latchbolt.</li>\r\n<li>Either lever operates latchbolt (except when outside lever is locked by key).</li>\r\n<li>Inside lever always active.</li>\r\n<li>Outside lever locked* or unlocked only by key.</li>\r\n</ul>', 'Heavy Duty Lever', 'Y1, GB, Sec', 'Augusta', 289.224, 222.48, 10, 'Au5408LN', 10, NULL, 17),
(30, 'Yale Locks', NULL, '2 -3/4"', '', '<h2>Passage or Closet Latch</h2>\r\n<p>&bull; For doors that do not require locking.<br />&bull; Either lever operates latchbolt at all times.</p>', 'Heavy Duty Lever', '', 'Augusta', 203.45, 156.5, 10, 'AU5401LN', 10, NULL, 18),
(31, 'Yale Locks', NULL, '2 -3/4"', '', '<h2>Privacy, Bedroom or Bath Lock</h2>\r\n<ul>\r\n<li>For lavatory or other privacy doors.</li>\r\n<li>Either lever operates latchbolt unless outside lever is locked by pushbutton inside.</li>\r\n<li>Button automatically releases when inside lever is turned or door is closed.</li>\r\n<li>Emergency release in outside lever.Emergency key supplied.</li>\r\n<li>Inside lever always active.</li>\r\n</ul>', 'Heavy Duty Lever', '', 'Augusta', 233.35, 179.5, 10, 'AU5402LN', 10, NULL, 20),
(32, 'Yale Locks', NULL, '2 -3/4"', '', '<h2><strong>Intruder Classroom Lock</strong></h2>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>For classroom doors.</li>\r\n<li>Deadlocking latchbolt.</li>\r\n<li>Either lever operates latchbolt (except when outside lever is locked by key from either side).</li>\r\n<li>Outside lever remains locked upon egress</li>\r\n<li>Inside lever always active.</li>\r\n</ul>', 'Heavy Duty Lever', 'Y1, GB, Sec', 'Augusta', 300.3, 231, 10, 'AU5418LN', 10, NULL, 21),
(33, 'Arrow Lock', NULL, '2 -3/4",  2-3/8"', '', '<h2><strong><span style="font-size: 9pt; font-family: ''Vesta-Bold'',''serif'';">&nbsp;Entrance/Office </span></strong></h2>\r\n<ul>\r\n<li><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';">Latchbolt operated by lever either side except<strong> </strong>when outside lever is locked by turn-button</span><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';"> inside. When outside lever is locked, latchbolt</span><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';"> operated by key outside or turning inside lever.</span></li>\r\n<li><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';">Pushing and turning inside button will cause</span><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';"> outside lever to remain locked. Button will</span><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';"> then need to be manually rotated to unlock</span><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';"> outside lever.</span></li>\r\n</ul>\r\n<p>&nbsp;REMOVABLE CORE NOT INCLUDED</p>', 'Medium Duty Lever', 'Arrow, I/C', 'Ventura Design', 150.8, 116, 10, 'ML11V', 5, NULL, 15),
(34, 'Arrow Lock', NULL, '2 -3/4", 2-3/8"', '', '<h2 class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal; mso-layout-grid-align: none; text-autospace: none;"><strong><span style="font-size: 9.0pt; font-family: ''Vesta-Bold'',''serif''; mso-bidi-font-family: Vesta-Bold;">Entrance/Office</span></strong></h2>\r\n<ul>\r\n<li><span style="font-size: 9pt; font-family: Symbol;"><span><span style="font: 7pt ''Times New Roman'';">&nbsp;</span></span></span><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';">Latch bolt operated by lever either side except when outside lever is locked by turn-button inside.</span></li>\r\n<li><span style="font-size: 9pt; font-family: ''Vesta'',''sans-serif'';">When outside lever is locked, latch bolt operated by key outside or turning inside lever.</span></li>\r\n<li><span style="font-size: 9.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;"><span style="font: 7.0pt ''Times New Roman'';">&nbsp;</span></span></span><span style="font-size: 9.0pt; font-family: ''Vesta'',''sans-serif''; mso-bidi-font-family: Vesta;">Pushing and turning inside button will cause outside lever to remain&nbsp;&nbsp; locked. Button will then need to be manually rotated to unlock outside lever.</span></li>\r\n</ul>\r\n<p>&nbsp;REMOVABLE CORE NOT INCLUDED</p>', 'Medium Duty Lever', 'Arrow, I/C', 'Sierra Design', 150.8, 116, 10, 'M11SR', 5, NULL, 15),
