(63, 'Schlage Lock', NULL, '2 -3/4", 2-3/8"', '', '<h2 class="MsoNormal">&nbsp;<strong>Entrance Lock</strong></h2>\r\n<ul>\r\n<li>Turn/push-button locking: Pushing and turning the button locks the outside lever, requiring use of a key until the button is manually unlocked.</li>\r\n</ul>\r\n<ul>\r\n<li>Push-button locking: Pushing button locks outside lever until unlocked by key or by turning</li>\r\n<li></li>\r\n</ul>\r\n<p>&nbsp;( REMOVABLE CORE NOT INCLUDED)</p>', 'Medium Duty Lever', 'C, C123, C145,  removable core', 'Jupiter(JUP)', 173.55, 133.5, 10, 'AL53 JUP', 5, NULL, 15),
(64, 'Schlage Lock', NULL, '2 -3/4", 2-3/8"', '', '<h2 class="MsoNormal"><strong>Entrance Lock</strong></h2>\r\n<p class="MsoNormal">&bull; Turn/push-button locking: Pushing and turning the button locks the outside lever, requiring use of a key until the button is manually unlocked.</p>\r\n<p class="MsoNormal">&bull; Push-button locking: Pushing button locks outside lever until unlocked by key or by turning</p>\r\n<p class="MsoNormal">( REMOVABLE CORE NOT INCLUDED)</p>', 'Medium Duty Lever', 'C, C123, C145,  removable core', 'Saturn Design', 173.55, 133.5, 10, 'AL53 SAT', 5, NULL, 15),
